const React = require('react');
const { FormControl, Button, InputGroup } = require('react-bootstrap');

export class URLShortener extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div>
        <h2>URL Shortener</h2>
        <InputGroup>
          <FormControl
            placeholder="http://example.com"
          />
          <InputGroup.Append>
            <Button variant="outline-primary">Get short</Button>
          </InputGroup.Append>
        </InputGroup>
      </div>
    )
  }
}
